#include <stdio.h>
#include <cstdlib>
#include <time.h>
#include "/Images.h"

using namespace std;

string Images::getImage(int index) {
	if(index<5)
		return this->images[index];
	else
		return this->images[0]   ;
}

string Images::getRandomImage(){
	srand(time(0));
	return this->images[rand()%5];  
}

Images::Images() {
	images[0] = "";
	images[1] = "";
	images[2] = "";
    images[3] = "";
    images[4] = "";
}